function removeAccents(str) {
  // Remove accents from characters
  return str.normalize('NFD').replace(/[\u0300-\u036f]/g, '');
}

function normalizeName(name) {
  if (!name || typeof name !== 'string') return '';
  
  // Remove accents
  let normalized = removeAccents(name);
  
  // Remove suffixes like Jr., Sr., III, IV
  normalized = normalized.toLowerCase().trim().replace(/\s+(jr\.?|sr\.?|iii?|iv)$/i, '');
  
  // Split into parts
  const parts = normalized.split(/\s+/);
  // If 2 or fewer parts, return as-is
  if (parts.length <= 2) return parts.join(' ');
  // Return first + last name (skip middle names)
  return `${parts[0]} ${parts[parts.length - 1]}`;
}

function matchesPlayer(name1, name2) {
  if (!name1 || !name2) return false;
  const norm1 = normalizeName(name1);
  const norm2 = normalizeName(name2);
  return norm1 === norm2;
}

export function isRookieCard(name, copyrightYear) {
  if (!name || !copyrightYear) return false;
  
  for (const [rookieName, rookieYear] of Object.entries(ROOKIE_YEARS)) {
    if (matchesPlayer(name, rookieName)) {
      try {
        const cardYear = parseInt(copyrightYear);
        // Rookie cards are from the year AFTER the player's rookie season
        return cardYear === rookieYear + 1;
      } catch {
        return false;
      }
    }
  }
  return false;
}

export function hasAwardInYear(name, copyrightYear, awardType) {
  if (!name || !copyrightYear) return false;

  let awardData;
  if (awardType === 'mvp') {
    awardData = MVP_YEARS;
  } else if (awardType === 'cy_young') {
    awardData = CY_YOUNG_YEARS;
  } else if (awardType === 'triple_crown') {
    awardData = TRIPLE_CROWN_YEARS;
  } else {
    return false;
  }

  for (const [playerName, years] of Object.entries(awardData)) {
    if (matchesPlayer(name, playerName)) {
      try {
        const cardYear = parseInt(copyrightYear);
        // Award cards are from the year AFTER the award was won
        return years.includes(cardYear - 1);
      } catch {
        return false;
      }
    }
  }
  return false;
}

// Convenience wrappers for specific awards
export function hasMVP(name, copyrightYear) {
  return hasAwardInYear(name, copyrightYear, 'mvp');
}

export function hasCyYoung(name, copyrightYear) {
  return hasAwardInYear(name, copyrightYear, 'cy_young');
}

export function hasTripleCrown(name, copyrightYear) {
  return hasAwardInYear(name, copyrightYear, 'triple_crown');
}
